import React from 'react';
import { FaqQuestion } from './Faqapi';
import './Faq.css';
import { useState } from 'react';
const Faq = () => {
    const [data, setFaq] = useState(FaqQuestion);
    return (
        <>
        {
            data.map((CurrentFaq) => {
            return CurrentFaq.question;
           })
        } 
        </>
    )
}

export default Faq
